People like @willmoseleymusic have the ability to change the landscape of this country – but only if their voices are heard.

Music is one of the most powerful tools to sway minds. A close second to humor, music is enjoyed by every person and its messaging resonates further than any of us can imagine. But the problem is those with values, morals, and a genuine love for America don’t get the opportunities afforded to Hollywood elites.

But – it CAN be done. Look at @hangovergang and what he’s accomplished. Billboard award for a pop song…and he’s a rapper who refused to sellout despite millions being thrown at him.

We are losing the culture war. It’s that simple. Let’s start pushing back against the cultural shift that’s transitioning the moral to the deviant and amplify voices who not only have a righteous message, but also…just sound so damn good.

